import React, { useState, useEffect } from "react";
import { Link } from "react-router-dom";
import "../../styles/Truckload.css";

// Import gallery images
import gallery1 from "../../assets/gallery/images/gallery1.jpg";
import gallery2 from "../../assets/gallery/images/gallery2.jpg";
import gallery3 from "../../assets/gallery/images/gallery3.jpg";
import gallery4 from "../../assets/gallery/images/gallery4.jpg";
import gallery5 from "../../assets/gallery/images/gallery5.jpg";
import gallery6 from "../../assets/gallery/images/gallery6.jpg";
import gallery7 from "../../assets/gallery/images/gallery7.jpg";
import gallery8 from "../../assets/gallery/images/gallery8.jpg";
import gallery9 from "../../assets/gallery/images/gallery9.jpg";
import gallery10 from "../../assets/gallery/images/gallery10.jpg";
import gallery11 from "../../assets/gallery/images/gallery11.jpg";
import gallery12 from "../../assets/gallery/images/gallery12.jpg";
import gallery13 from "../../assets/gallery/images/gallery13.jpg";
import gallery14 from "../../assets/gallery/images/gallery14.jpg";
import gallery15 from "../../assets/gallery/images/gallery15.jpg";
import gallery16 from "../../assets/gallery/images/gallery16.jpg";
import gallery17 from "../../assets/gallery/images/gallery17.jpg";
import gallery18 from "../../assets/gallery/images/gallery18.jpg";
import gallery19 from "../../assets/gallery/images/gallery19.jpg";

function Truckload() {
  const heroImages = [gallery1, gallery2, gallery3];
  const mainImages = [
    gallery4, gallery5, gallery6, gallery7, gallery8, gallery9,
    gallery10, gallery11, gallery12, gallery13, gallery14, gallery15,
    gallery16, gallery17, gallery18, gallery19
  ];

  const [currentHero, setCurrentHero] = useState(0);
  const [currentMain, setCurrentMain] = useState(0);

  useEffect(() => {
    const heroInterval = setInterval(() => {
      setCurrentHero((prev) => (prev + 1) % heroImages.length);
    }, 4000);

    const mainInterval = setInterval(() => {
      setCurrentMain((prev) => (prev + 1) % mainImages.length);
    }, 3500);

    return () => {
      clearInterval(heroInterval);
      clearInterval(mainInterval);
    };
  }, []);

  return (
    <div className="rgm-truckload-page">

      {/* HERO */}
      <section className="rgm-truckload-hero">
        <img src={heroImages[currentHero]} alt="Hero Slide" className="hero-slide"/>
        <div className="hero-content">
          <h1>Flatbed Truckload Solutions</h1>
          <p>
            Built on Trust ‚Ä¢ Safety ‚Ä¢ Reliable Flatbed Capacity
          </p>
        </div>
      </section>

      {/* INTRO */}
      <section className="rgm-truckload-intro">
        <p>
          <strong>RGM Truckload</strong> specializes in full flatbed shipments
          that require experienced drivers, proper securement, and
          dependable communication from pickup to delivery.
        </p>
      </section>

      {/* MAIN SLIDESHOW & FEATURES */}
      <section className="rgm-truckload-main">
        <h2>Truckload Capabilities & Highlights</h2>

        <div className="main-slideshow">
          <img src={mainImages[currentMain]} alt="Main Slide"/>
        </div>

        <div className="features-grid">
          <div className="feature-card">üöõ Flatbed & Stepdeck Capacity</div>
          <div className="feature-card">üîí Securement-Focused Operations</div>
          <div className="feature-card">üß∞ Construction & Industrial Freight</div>
          <div className="feature-card">üìç Regional & Nationwide Coverage</div>
          <div className="feature-card">üì° Real-Time Load Updates</div>
          <div className="feature-card">ü§ù Trusted Owner-Operators</div>
        </div>
      </section>

      {/* WHY RGM */}
      <section className="rgm-truckload-why">
        <h2>Why RGM Truckload?</h2>
        <p>
          We may be a growing company, but our approach is simple:
          treat every load like it belongs to family.
        </p>
        <p>
          Clear communication, honest timelines, and safe execution
          are non-negotiable at RGM.
        </p>
      </section>

      {/* FOOTPRINT */}
      <section className="rgm-truckload-footprint">
        <h2>Our Reach</h2>
        <p>
          RGM provides flatbed truckload service across key U.S. corridors,
          supporting regional and long-haul freight with reliable capacity.
        </p>
      </section>

      {/* CTA */}
      <section className="rgm-truckload-cta">
        <h2 className="cta-headline">Ready to Move a Flatbed Load?</h2>
        <p>
          Contact RGM today for dependable flatbed truckload solutions
          built on trust and accountability.
        </p>

        <div className="cta-buttons">
          <Link to="/contact" className="cta-primary">
            Get A Quote
          </Link>
          <Link to="/contact" className="cta-secondary">
            Click to Call
          </Link>
        </div>
      </section>

    </div>
  );
}

export default Truckload;
